import React, { useState } from 'react';
import tradeImage from './trade.jpg';

function Signup({ onSignup }) {
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Store user credentials (in a real app, you'd want to store this securely)
        localStorage.setItem('user', JSON.stringify({ username, password }));
        onSignup(); // Call this on successful signup
    };

    return (
        <div
            style={{
                minHeight: '100vh',
                backgroundImage: `url(${tradeImage})`,
                backgroundSize: 'cover',
                backgroundPosition: 'center',
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                padding: '20px',
            }}
        >
            <div
                style={{
                    backgroundColor: 'rgba(255, 255, 255, 0.85)',
                    padding: '30px',
                    borderRadius: '10px',
                    width: '100%',
                    maxWidth: '450px',
                    boxShadow: '0 4px 15px rgba(0,0,0,0.2)'
                }}
            >
                <h1 className="mb-4 text-center">Signup on TradGoo</h1>
                <form onSubmit={handleSubmit} className="needs-validation" noValidate>
                    <div className="mb-3">
                        <label htmlFor="username" className="form-label">Username</label>
                        <input
                            name="username"
                            id="username"
                            type="text"
                            className="form-control"
                            required
                            value={username}
                            onChange={(e) => setUsername(e.target.value)}
                        />
                        <div className="valid-feedback">Looks Good!</div>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="email" className="form-label">Email</label>
                        <input
                            name="email"
                            id="email"
                            type="email"
                            className="form-control"
                            required
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="password" className="form-label">Password</label>
                        <input
                            name="password"
                            id="password"
                            type="password"
                            className="form-control"
                            required
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                        />
                    </div>
                    <button className="btn btn-success w-100">Signup</button>
                </form>
            </div>
        </div>
    );
}

export default Signup;
